CTID,')) GROUP BY U.ULD_ID,U.ULD_LOGINID' )); PREPARE INSERT_TEMP_TABLE_STMT FROM @INSERT_TEMP_TABLE; EXECUTE INSERT_TEMP_TABLE_STMT; SET @SETMINID=(SELECT CONCAT('SELECT MIN(ID) INTO @MIN_ID FROM ',TEMP_TABLE)); PREPARE SETMINID_STMT FROM @SETMINID; EXECUTE SETMINID_STMT; SET MINID=@MIN_ID; SET @SETMAXID=(SELECT CONCAT('SELECT MAX(ID) INTO @MAX_ID FROM ',TEMP_TABLE)); PREPARE SETMAXID_STMT FROM @SETMAXID; EXECUTE SETMAXID_STMT; SET MAXID=@MAX_ID; SET @CHECKFLAG=1; SET @CREATE_TEMP_PROJECT_REVENUE_DTLS = (SELECT CONCAT('CREATE TABLE ',TEMP_PROJECT_REVENUE_DTLS,'( ID INTEGER NOT NULL AUTO_INCREMENT, USER_NAME VARCHAR(50), TOTAL_DAYS TEXT, TOTAL_HRS TEXT, TOTAL_MINUTES TEXT, PRIMARY KEY(ID))')); PREPARE CREATE_TEMP_PROJECT_REVENUE_DTLS_STMT FROM @CREATE_TEMP_PROJECT_REVENUE_DTLS; EXECUTE CREATE_TEMP_PROJECT_REVENUE_DTLS_STMT; DEALLOCATE PREPARE CREATE_TEMP_PROJECT_REVENUE_DTLS_STMT; SET @CHECKFLAG=2; WHILE MINID<=MAXID DO SET @SETUSERID=(SELECT CONCAT('SELECT ULDID INTO @USERID FROM ',TEMP_TABLE,' WHERE ID=',MINID)); PREPARE SETUSERID_STMT FROM @SETUSERID; EXECUTE SETUSERID_STMT; SET USER_ID=@USERID ; SET @SETUSERNAME=(SELECT CONCAT('SELECT USER_NAME INTO @TEMP_USER_NAME FROM ',TEMP_TABLE,' WHERE ID=',MINID)); PREPARE SETUSERNAME_STMT FROM @SETUSERNAME; EXECUTE SETUSERNAME_STMT; SET USERNAME=@TEMP_USER_NAME ; SET @CHECKFLAG=3; IF SEARCH_OPTION=1 THEN SET @PROJECT_DAYS=(SELECT CONCAT('SELECT SUM(EPR_DAYS),SUM(EPR_HRS),SUM(EPR_MINUTES) INTO @PROJ_DAYS,@PROJ_HRS,@PROJ_MINUTES FROM EMPLOYEE_PROJECT_REVENUE WHERE UARD_ID IN (SELECT UARD_ID FROM USER_ADMIN_REPORT_DETAILS WHERE (ULD_ID=',USER_ID,') AND ((UARD_PSID LIKE ','"','%,',PROJECTID,',%','"',') OR (UARD_PSID LIKE ','"','%,',PROJECTID,'"',') OR (UARD_PSID=',PROJECTID,')))')); PREPARE PROJECT_DAYS_STMT FROM @PROJECT_DAYS; EXECUTE PROJECT_DAYS_STMT; END IF; SET @CHECKFLAG=4;  IF SEARCH_OPTION=2 THEN SET @PROJECT_DAYS=(SELECT CONCAT('SELECT SUM(EPR_DAYS),SUM(EPR_HRS),SUM(EPR_MINUTES) INTO @PROJ_DAYS,@PROJ_HRS,@PROJ_MINUTES FROM EMPLOYEE_PROJECT_REVENUE WHERE UARD_ID IN (SELECT UARD_ID FROM USER_ADMIN_REPORT_DETAILS WHERE (ULD_ID=',USER_ID,') AND UARD_DATE BETWEEN ','"',FROMDATE,'"',' AND ','"',TODATE,'"',' AND ((UARD_PSID LIKE ','"','%,',PROJECTID,',%','"',') OR (UARD_PSID LIKE ','"','%,',PROJECTID,'"',') OR (UARD_PSID=',PROJECTID,')))')); PREPARE PROJECT_DAYS_STMT FROM @PROJECT_DAYS; EXECUTE PROJECT_DAYS_STMT;			END IF; IF @PROJ_MINUTES IS NULL THEN SET @PROJ_MINUTES=0; END IF; SET @CHECKFLAG=5;  IF @PROJ_HRS IS NULL THEN SET @PROJ_HRS=0;  END IF;  IF @PROJ_DAYS IS NULL THEN SET @PROJ_DAYS=0; END IF; SET SUMHRS=@PROJ_HRS*60; SET SUMDAYS=@PROJ_DAYS*8*60; SET TOTALHRSINMINS=@PROJ_MINUTES+SUMHRS+SUMDAYS; SET @CHECKFLAG1=TOTALHRSINMINS; SET Q_FORMINS=(SELECT FLOOR(TOTALHRSINMINS/60)); SET @CHECKFLAG2=Q_FORMINS; SET R_FORMINS=(SELECT TOTALHRSINMINS % 60); SET @CHECKFLAG3=R_FORMINS; SET Q_FORHRS=(SELECT FLOOR(Q_FORMINS/8)); SET @CHECKFLAG4=Q_FORHRS; SET R_FORHRS=(SELECT Q_FORMINS % 8); SET @CHECKFLAG5=R_FORHRS; SET @T_DAYS=Q_FORHRS; SET @T_HRS=R_FORHRS; SET @T_MIN=R_FORMINS; SET @CHECKFLAG=6; SET @INSERT_TEMP_PROJECT_REVENUE_DTLS = (SELECT CONCAT('INSERT INTO ',TEMP_PROJECT_REVENUE_DTLS,' ( USER_NAME,TOTAL_DAYS,TOTAL_HRS,TOTAL_MINUTES) VALUES (','"',USERNAME,'"',',@T_DAYS,@T_HRS,@T_MIN)')); PREPARE INSERT_TEMP_PROJECT_REVENUE_DTLS_STMT FROM @INSERT_TEMP_PROJECT_REVENUE_DTLS; EXECUTE INSERT_TEMP_PROJECT_REVENUE_DTLS_STMT; DEALLOCATE PREPARE INSERT_TEMP_PROJECT_REVENUE_DTLS_STMT; SET @CHECKFLAG=7; SET @UPDATE_TEMP_PROJECT_DAYS= (SELECT CONCAT('UPDATE ',TEMP_PROJECT_REVENUE_DTLS,' SET TOTAL_DAYS=" "  WHERE TOTAL_DAYS=0')); PREPARE UPDATE_TEMP_PROJECT_DAYS_STMT FROM @UPDATE_TEMP_PROJECT_DAYS; EXECUTE UPDATE_TEMP_PROJECT_DAYS_STMT; SET @CHECKFLAG=8; DEALLOCATE PREPARE UPDATE_TEMP_PROJECT_DAYS_STMT; SET @UPDATE_TEMP_PROJECT_HRS= (SELECT CONCAT('UPDATE ',TEMP_PROJECT_REVENUE_DTLS,' SET TOTAL_HRS=" " WHERE TOTAL_HRS=0')); PREPARE UPDATE_TEMP_PROJECT_HRS_STMT FROM @UPDATE_TEMP_PROJECT_HRS; EXECUTE UPDATE_TEMP_PROJECT_HRS_STMT; DEALLOCATE PREPARE UPDATE_TEMP_PROJECT_HRS_STMT; SET @CHECKFLAG=9; SET @UPDATE_TEMP_PROJECT_MINUTES= (SELECT CONCAT('UPDATE ',TEMP_PROJECT_REVENUE_DTLS,' SET TOTAL_MINUTES=" " WHERE TOTAL_MINUTES=0')); PREPARE UPDATE_TEMP_PROJECT_MINUTES_STMT FROM @UPDATE_TEMP_PROJECT_MINUTES; EXECUTE UPDATE_TEMP_PROJECT_MINUTES_STMT; SET @CHECKFLAG=10; DEALLOCATE PREPARE UPDATE_TEMP_PROJECT_MINUTES_STMT; SET @SET_DELETE=(SELECT CONCAT('DELETE FROM ',TEMP_PROJECT_REVENUE_DTLS,' WHERE TOTAL_DAYS=" " AND TOTAL_HRS=" " AND TOTAL_MINUTES=" "')); PREPARE SET_DELETE_STMT FROM @SET_DELETE; EXECUTE SET_DELETE_STMT; SET  @PROJ_DAYS=NULL; SET @PROJ_HRS=NULL; SET @PROJ_MINUTES=NULL; SET @T_DAYS=NULL; SET @T_HRS=NULL; SET @T_MIN=NULL; SET MINID=MINID+1; END WHILE; SET @SETSUMMIN=(SELECT CONCAT('SELECT SUM(TOTAL_MINUTES) INTO @S_MIN  FROM ',TEMP_PROJECT_REVENUE_DTLS));  PREPARE SETSUMMINSTMT FROM @SETSUMMIN; EXECUTE SETSUMMINSTMT; SET TOTALSUMMIN=@S_MIN; SET @SETSUMHRS=(SELECT CONCAT('SELECT SUM(TOTAL_HRS) INTO @S_HRS FROM ',TEMP_PROJECT_REVENUE_DTLS)); PREPARE SETSUMHRSSTMT FROM @SETSUMHRS; EXECUTE SETSUMHRSSTMT; SET TOTALSUMHRS=@S_HRS*60; SET @SETSUMDAYS=(SELECT CONCAT('SELECT SUM(TOTAL_DAYS) INTO @S_DAYS  FROM ',TEMP_PROJECT_REVENUE_DTLS)); PREPARE SETSUMDAYSSTMT FROM @SETSUMDAYS; EXECUTE SETSUMDAYSSTMT; SET TOTALSUMDAYS=@S_DAYS*8*60; SET TOTHRSINMINS=TOTALSUMMIN+TOTALSUMHRS+TOTALSUMDAYS; SET Q_FORMINS=(SELECT FLOOR(TOTHRSINMINS/60)); SET R_FORMINS=(SELECT TOTHRSINMINS % 60); SET Q_FORHRS=(SELECT FLOOR(Q_FORMINS/8)); SET R_FORHRS=(SELECT Q_FORMINS % 8); IF Q_FORHRS IS NOT NULL AND R_FORHRS=0 AND R_FORMINS=0 THEN SET NO_OF_DAYS_WORKED=(SELECT CONCAT(Q_FORHRS,' DAYS')); ELSEIF Q_FORHRS=0 AND R_FORHRS!=0 AND R_FORMINS=0 THEN SET NO_OF_DAYS_WORKED=(SELECT CONCAT(R_FORHRS,' HRS')); ELSEIF Q_FORHRS=0 AND R_FORHRS=0 AND R_FORMINS!=0 THEN SET NO_OF_DAYS_WORKED=(SELECT CONCAT(R_FORMINS,' MINUTES')); ELSEIF Q_FORHRS!=0 AND R_FORHRS!=0 AND R_FORMINS=0 THEN SET NO_OF_DAYS_WORKED=(SELECT CONCAT(Q_FORHRS,' DAYS',' ',R_FORHRS,' HRS')); ELSEIF  Q_FORHRS !=0 AND R_FORHRS=0 AND R_FORMINS !=0 THEN SET NO_OF_DAYS_WORKED=(SELECT CONCAT(Q_FORHRS,' DAYS',' ',R_FORMINS,' MINUTES')); ELSEIF  Q_FORHRS =0 AND R_FORHRS !=0 AND R_FORMINS!=0 THEN SET NO_OF_DAYS_WORKED=(SELECT CONCAT(R_FORHRS,' HRS',' ',R_FORMINS,' MINUTES')); ELSE SET NO_OF_DAYS_WORKED=(SELECT CONCAT(Q_FORHRS,' DAYS',' ',R_FORHRS,' HRS',' ',R_FORMINS,' MINUTES')); END IF; SET @SUM_DAYS=Q_FORHRS; SET @SUM_HOURS=R_FORHRS; IF Q_FORHRS!=0 AND R_FORHRS!=0 AND R_FORMINS!=0 THEN SET NO_OF_HOURS=(SELECT CONCAT(((Q_FORHRS*8)+R_FORHRS),' HRS ',R_FORMINS,' MINUTES')); ELSEIF Q_FORHRS!=0 AND  R_FORHRS !=0 AND R_FORMINS=0 THEN SET @HOURS_WORKED=1; SET NO_OF_HOURS=(SELECT CONCAT(((Q_FORHRS*8)+R_FORHRS),' HRS ')); ELSEIF Q_FORHRS=0 AND R_FORHRS!=0 AND R_FORMINS=0 THEN SET NO_OF_HOURS=(SELECT CONCAT(R_FORHRS,' HRS ')); ELSEIF Q_FORHRS!=0 AND R_FORHRS=0 AND R_FORMINS!=0 THEN SET NO_OF_HOURS=(SELECT CONCAT((Q_FORHRS*8),' HRS ',R_FORMINS,' MINUTES')); ELSEIF R_FORMINS!=0 AND Q_FORHRS=0 AND R_FORHRS=0  THEN SET NO_OF_HOURS=(SELECT CONCAT(R_FORMINS,' MINUTES ')); ELSEIF Q_FORHRS!=0 AND R_FORHRS=0 AND R_FORMINS=0 THEN SET NO_OF_HOURS=(SELECT CONCAT((Q_FORHRS*8),' HRS ')); END IF; SET @DROPQUERY=(SELECT CONCAT('DROP TABLE IF EXISTS ',TEMP_TABLE)); PREPARE DROPQUERYSTMT FROM @DROPQUERY; EXECUTE DROPQUERYSTMT; COMMIT; END//
