CREATE  PROCEDURE `SP_TRG_EMPLOYEE_PROJECT_REVENUE`(UARDID INTEGER,ATTENDANCE INTEGER,PERMISSION INTEGER,UARDPSID TEXT)
BEGIN DECLARE PROJECT_COUNT INTEGER; DECLARE TOTALHRS INTEGER; DECLARE PERMISSIONHRS INTEGER; DECLARE TOTAL INTEGER; DECLARE TOTHRS INTEGER; DECLARE TOTMIN INTEGER; IF UARDPSID IS NOT NULL THEN SET PROJECT_COUNT=(SELECT((LENGTH(UARDPSID) - LENGTH(REPLACE(UARDPSID, ",", ""))) / LENGTH(",")+1) ); IF ATTENDANCE=5 THEN SET TOTALHRS=8*60; END IF; IF ATTENDANCE=4 OR ATTENDANCE=8 THEN SET TOTALHRS=4*60; END IF; IF PERMISSION IS NOT NULL THEN SET PERMISSIONHRS=(SELECT AC_DATA FROM ATTENDANCE_CONFIGURATION WHERE AC_ID=PERMISSION AND CGN_ID=6)*60; SET TOTALHRS=TOTALHRS-PERMISSIONHRS; END IF; SET TOTAL=(TOTALHRS/PROJECT_COUNT); SET TOTHRS=(SELECT FLOOR(TOTAL/60)); SET TOTMIN=(TOTAL%60); IF TOTHRS=8 THEN INSERT INTO EMPLOYEE_PROJECT_REVENUE(UARD_ID,EPR_NO_OF_PROJECT,EPR_DAYS)VALUES(UARDID,PROJECT_COUNT,1); ELSEIF TOTHRS=4 THEN INSERT INTO EMPLOYEE_PROJECT_REVENUE(UARD_ID,EPR_NO_OF_PROJECT,EPR_DAYS)VALUES(UARDID,PROJECT_COUNT,0.5); ELSE INSERT INTO EMPLOYEE_PROJECT_REVENUE(UARD_ID,EPR_NO_OF_PROJECT,EPR_HRS,EPR_MINUTES)VALUES(UARDID,PROJECT_COUNT,TOTHRS,TOTMIN); END IF; END IF; END//
DELIMITER ;


